/** @format */

import React from "react";
import "antd/dist/antd.css";
import Head from "next/head";
import styled from "styled-components";

const AppLayout = styled.div`
  margin: 0 auto;
  max-width: 768px;
  height: 100vh;
  a {
    text-align: center;
  }
`;
// eslint-disable-next-line react/prop-types
const App = ({ Component }) => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>규몽이츠</title>
      </Head>
      <AppLayout>
        <Component />
      </AppLayout>
    </>
  );
};

export default App;
